import React from "react";
import Notes from "./Note";

function Note() {
  return (
    <div className="note">
      {Notes.map((props) => (
        <noteDetails
          key={props.key}
          nTitle={props.title}
          nContent={props.content}
        />
      ))}
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
}

export default Note;
